import React, { Component } from 'react';

class Home extends Component {
    render() {
        return (
                        <div style={{textAlign:"left"}}>

                <h1>Hello there! My name is Tasnim Ali and I am a software developer who designs fullstack web applications. Hopefully I can help you with your next project? </h1>
            </div>
        );
    }
}

export default Home;
